<html ng-app="install">
<head>
	<meta charset="utf-8">
	<title>Instalação</title>
	<script src="{$path}/res/theme/assets/vendor/angular/angular.min.js"></script>
	<link rel="stylesheet" href="{$path}/res/theme/material/global/css/bootstrap.min.css">
	<link rel="stylesheet" href="{$path}/res/theme/material/global/vendor/alertify/alertify.min.css">
    <link rel="stylesheet" type="text/css" href="{$path}/res/css/install.css">
	<script>
    window.PATH = '{$path}';
	</script>
</head>
<body>
	<div class="container" ng-controller="sql">
		<h1>Instalação</h1>
		<hr>
		<h2>Banco de Dados</h2>
		<p>O servidor, usuário e senha devem ser definidos no arquivo <code>inc/consts.php</code></p>
		<button id="btn-installDB" ng-click="install()" class="btn btn-success btn-block">Instalar Banco de Dados</button>
		<table class="table table-striped table-condensed">
			<thead>
				<tr>
					<th>Objetos</th>
					<th>Status</th>
				</tr>
			</thead>
			<tbody>
				<tr ng-repeat="object in objects" ng-class="{success:object.success, warning:object.warning, danger:object.danger}">
					<td>{{object.name}}</td>
					<td>{{object.status}}</td>
				</tr>
			</tbody>
			<tfoot>
				<tr>
					<td>Cidades Inseridas</td>
					<td>{{citiesTotal}}</td>
				</tr>
			</tfoot>
		</table>
	</div>
</body>

System = {};

function getPageSize(){

    var scnWid, scnHei;
    if (self.innerHeight) {
        scnWid = self.innerWidth;
        scnHei = self.innerHeight;
    } else if (document.documentElement && document.documentElement.clientHeight) {
        scnWid = document.documentElement.clientWidth;
        scnHei = document.documentElement.clientHeight;
    } else if (document.body) {
        scnWid = document.body.clientWidth;
        scnHei = document.body.clientHeight;
    }

    return {width:scnWid, height:scnHei};

}
angular.module("install", []).controller("sql", function($scope, $http){

	$scope.citiesTotal = 0;

	$scope.install = function(){

		console.warn("Apagando o banco de dados atual...");

		$('#btn-installDB').btnload('load');

		rest({
			$http:$http,
			url:PATH+"/install-admin/sql/clear",
			success:function(){
				console.info("Iniciando instalação...");

				$('#btn-installDB').btnload('unload');

				$scope.installDataBase(0, $scope.objects);
			},
			failure:function(e){
				console.error(e);
			}
		});

	};

	$scope.insertCity = function(index, cities, callback){

		if (index >= cities.length && typeof callback === 'function') {

			callback();

		} else {

			var step = 250;
			var data = [];

			for (var i = index; i < (index+step); i++) {
				if (cities.length > i) {
					data.push(cities[i]);
				}
			}

			rest({
				$http:$http,
				url:PATH+"/install-admin/sql/addresses/cities/inserts",
				method:'POST',
				data:{
					json:JSON.stringify(data)
				},
				success:function(r){

					index+=step;
					$scope.insertCity(index, cities, callback);
					$scope.citiesTotal = index;

				},
				failure:function(e){
					console.error(e);
				}
			});

		}

	};

	$scope.installDataBase = function(_index, _objects){

		$('#btn-installDB').btnload('load');

		if (_index >= _objects.length) {

			$('#btn-installDB').btnload('unload');

			$scope.insertsCities(function(){

				alertify.alert("Banco Criado com Sucesso!");

			});

		} else {

			var $tr = $($('table tbody tr')[_index]);

			var hM = getPageSize().height/2;

			if ($tr.position().top > hM) {
				$(document).scrollTop($tr.position().top - hM);
			}

			if (_objects[_index].enabled === true) {

				_objects[_index].status = "processing";
				_objects[_index].warning = true;

				try{

					rest({
						$http:$http,
						url:PATH+'/install-admin'+_objects[_index].url,
						success:function(r){

							_objects[_index].status = "success";
							_objects[_index].warning = false;
							_objects[_index].success = true;
							$scope.installDataBase(++_index, _objects);

						},
						failure:function(r){

							_objects[_index].warning = false;
							_objects[_index].danger = true;
							_objects[_index].status = r.error | "failure";
							$scope.installDataBase(++_index, _objects);

						}
					});

				} catch(e) {

					console.warn(e);

				}


			} else {

				_objects[_index].status = "disabled";
				$scope.installDataBase(++_index, _objects);

			}

		}

	};
